storyline:-

he Tang emperor is betrayed by one of his generals, who installs himself as emperor in the East Capital. The son of one of his slave workers escapes to the Shaolin Temple, learns kung fu, and sets out to kill the traitor, who killed his father. The monks have to help him, and in the process, they save the true emperor, who rewards them greatly. Based on a true story from Shaolin folklore, but highly fictionalized.


